import React from 'react';

export default function Nav() {
    const linkStyle = { border: '1px black', padding: '5px' };
  
    return (
      <nav >
          <div style={linkStyle}>
            <a href="#">Home</a>
          </div>
          <div style={linkStyle}>
            <a href="#">Portfolio</a>
          </div>
          <div style={linkStyle}>
            <a href="#">Contact</a>
          </div>
          <div style={linkStyle}>
            <a href="#">Resume</a>
          </div>
      </nav>
    );
  }
